import React, {useState} from 'react';
import './App.css';
import Todolist, {taskType} from "./Todolist";

function App() {
    const todoListTitle_1: string = "What to learn"
    const todoListTitle_2: string = "What to byu";



    const removeTask = (taskId:number) => {
        result = result.filter(task => task.id !== taskId)
    }

     const result  = useState<Array<taskType>>([
        {id:0, title: "HTML", isDone: true},
        {id:1, title: "JS", isDone: false},
        {id:3, title: "React", isDone: false},
        {id:4, title: "Redux", isDone: false},
        {id:5, title: "Git", isDone: false}
    ])
    return (
        <div className="App">
            <Todolist title={todoListTitle_1} tasks={result}/>

        </div>
    );
}

export default App;
